import { useParams } from 'react-router-dom';
import '../ComponentsCss/ProductStatusTag.css';

function ProductStatusTag({productStatus}) {

    function renderSwitch(productStatus) {
        switch(productStatus) {
          case 'active':
            return <span className="statusTag border border-primary bg-primary rounded-pill">
                    Aktiv
                </span>;
          case 'sold':
            return <span className="statusTag border border-danger bg-danger rounded-pill">
                    Solgt
                    </span>
          default:
            return 'foo';
        }
      }
    
    return(
        
        <div>
            {renderSwitch(productStatus)}
        </div>
    )
}

export default ProductStatusTag;
